import * as React from "react";

class MyComponent extends React.Component {
    state = {
        first: false,
        second: false,
    };

    render() {
        const { first, second } = this.state;

        return (
            <main>
                <section>
                    <button disabled={first}>First</button>
                </section>
                <section>
                    <button disabled={second}>Second</button>
                </section>
            </main>
        );
    }
}

export default MyComponent;
